import React from 'react';
import './Nav.css';

function Nav() {
    return (
        <div className="navbar">
            <div className="navigationContainer">
                <div className="active-link linkContainer"><a href="#overview" className="navLink">Overview</a></div>
                <div className="linkContainer"><a href="#experience" className="navLink">Experience</a></div>
                <div className="linkContainer"><a href="#projects" className="navLink">Projects</a></div>
                <div className="linkContainer"><a href="#about" className="navLink">About Me</a></div>
            </div>
        </div>
    )
}

export default Nav
